//     <AddTodo />
//     <VisibleTodoList />
//     <Footer />
//   </div>
// )

const App = ({ match: { params } }) => {
  return (
    <div>
      <AddTodo />
      <VisibleTodoList filter={params.filter || 'SHOW_ALL'} />
      <Footer />
    </div>
  )
}

export default App
